import React, { useEffect, useState } from 'react';

const messageText = `...`; // Your birthday message text

const petalColors = [
  'rgba(255, 182, 193, 0.8)', // light pink
  'rgba(255, 105, 97, 0.7)',  // soft red
  'rgba(220, 20, 60, 0.6)',   // crimson
];

type Petal = {
  id: number;
  left: number;
  size: number;
  color: string;
  duration: number;
  delay: number;
  rotate: number;
  rotateDuration: number;
};

type UserInfo = {
  _id: string;
  ipAddress: string;
  deviceInfo: { device: string; os: string; browser: string };
  city: string;
  timestamp: string;
};

const galleryImages = [
  { src: './images/1.jpeg', alt: 'Our First Trip', caption: 'Our First Trip' },
  { src: './images/2.jpeg', alt: 'Best Hangout Ever', caption: 'Best Hangout Ever' },
  { src: './images/3.jpeg', alt: 'Candid Laughs', caption: 'Candid Laughs' },
  { src: './images/4.jpeg', alt: 'Special Occasion', caption: 'Special Occasion' },
];

const App: React.FC = () => {
  const [typedText, setTypedText] = useState('');
  const [petals, setPetals] = useState<Petal[]>([]);
  const [mongoData, setMongoData] = useState<UserInfo[] | null>(null);

  // Typing effect
  useEffect(() => {
    let index = 0;
    const interval = setInterval(() => {
      setTypedText((prev) => prev + messageText.charAt(index));
      index++;
      if (index >= messageText.length) clearInterval(interval);
    }, 40);
    return () => clearInterval(interval);
  }, []);

  // Generate petals
  useEffect(() => {
    const petalsArray: Petal[] = [];
    for (let i = 0; i < 15; i++) {
      petalsArray.push({
        id: i,
        left: Math.random() * 100,
        size: 10 + Math.random() * 15,
        color: petalColors[Math.floor(Math.random() * petalColors.length)],
        duration: 12 + Math.random() * 8,
        delay: Math.random() * 15,
        rotate: Math.random() * 360,
        rotateDuration: 6 + Math.random() * 6,
      });
    }
    setPetals(petalsArray);
  }, []);

  // Fetch data from MongoDB backend
  useEffect(() => {
    fetch("http://localhost:5000/api/user-info")
      .then((res) => res.json())
      .then((data) => setMongoData(data))
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  return (
    <>
      <header>Happy Birthday, Shan!</header>
      <section className="birthday-message">{typedText}</section>
      <section className="gallery-section">
        <h2>Some of Our Favorite Moments Together</h2>
        <div className="gallery-grid">
          {galleryImages.map(({ src, alt, caption }, i) => (
            <div key={i} className="gallery-item">
              <img src={src} alt={alt} />
              <div className="caption">{caption}</div>
            </div>
          ))}
        </div>
      </section>

      <section className="mongo-data-section">
        <h2>Recent User Info</h2>
        {mongoData ? (
          mongoData.map((data) => (
            <div key={data._id} className="mongo-data-item">
              <p><strong>IP Address:</strong> {data.ipAddress}</p>
              <p><strong>Device:</strong> {data.deviceInfo.device}</p>
              <p><strong>OS:</strong> {data.deviceInfo.os}</p>
              <p><strong>Browser:</strong> {data.deviceInfo.browser}</p>
              <p><strong>City:</strong> {data.city}</p>
            </div>
          ))
        ) : (
          <p>Loading data...</p>
        )}
      </section>

      <footer>Here's to another year of unforgettable memories. Love you lots, Aliyah 💕🧁</footer>

      {petals.map(({ id, left, size, color, duration, delay, rotate, rotateDuration }) => (
        <div
          key={id}
          className="petal"
          style={{
            left: `${left}vw`,
            width: `${size}px`,
            height: `${size * 0.6}px`,
            backgroundColor: color,
            animationDuration: `${duration}s, ${rotateDuration}s`,
            animationDelay: `${delay}s, ${delay}s`,
            transform: `rotate(${rotate}deg)`,
          }}
          aria-hidden="true"
        />
      ))}
    </>
  );
};

export default App;
